tables.table_schema:
CREATE TABLE Extraction (
    id INT,
    extracted_data TEXT,
    extracted_at TIMESTAMP
);

CREATE TABLE Transformation (
    id INT,
    extracted_data TEXT,
    transformed_data JSONB,
    transformed_at TIMESTAMP
);

CREATE TABLE etl_extract (
    id INT PRIMARY KEY,
    source_table VARCHAR NOT NULL,
    status VARCHAR NOT NULL
);

CREATE TABLE etl_transform (
    id INT PRIMARY KEY,
    source_column VARCHAR NOT NULL,
    transformed_column VARCHAR NOT NULL
);

CREATE TABLE etl_load (
    id INT PRIMARY KEY,
    target_table VARCHAR NOT NULL,
    load_status VARCHAR NOT NULL
);

CREATE TABLE extracted_data (
    id INT PRIMARY KEY,
    data VARCHAR
);

CREATE TABLE transformed_data (
    id INT PRIMARY KEY,
    transformed_data VARCHAR
);

CREATE TABLE machine_learning_model (
    id INT PRIMARY KEY,
    model_name VARCHAR,
    algorithm VARCHAR,
    accuracy FLOAT
);

CREATE TABLE prediction_results (
    id INT PRIMARY KEY,
    sample_id INT,
    prediction_value FLOAT
);

CREATE TABLE ETL_Extract (
    id INT PRIMARY KEY,
    source_table VARCHAR,
    extract_date DATE
);

CREATE TABLE ETL_Transform (
    id INT PRIMARY KEY,
    extract_id INT,
    transformed_data VARCHAR,
    transform_date DATE
);

CREATE TABLE ETL_Load (
    id INT PRIMARY KEY,
    transform_id INT,
    final_data VARCHAR,
    load_date DATE
);

CREATE TABLE ML_Model (
    id INT PRIMARY KEY,
    model_name VARCHAR,
    model_type VARCHAR,
    trained_date DATE
);

CREATE TABLE ML_Prediction (
    id INT PRIMARY KEY,
    model_id INT,
    prediction_data VARCHAR,
    prediction_date DATE
);
